import './App.css';

const Header = ({title})=>{
  return(
  <heaer>
    <h1>
      <a href="#">{title}</a>
    </h1>
  </heaer>
  );
}

const Nav = ({title})=>{
  const liList = title.map((element)=>
  <li>{element}</li>
  );

  return(
    {liList}
  );
}

const Article = ({title, body})=>{
  return(
  <article>
        <h3>{title}</h3>
        {body}
  </article>
  );
}
const App = () => {
  const lists = [
    {title : "html"},
    {title : "css"},
    {title : "js"}
  ]

  return(
    <>
      <Header title="WEB"/>
      <Nav title={lists}/>
      <Article title="Welcom" body="Hello, WEB"/>
    </>
  )
};

export default App;
